import React from "react";
import ReactCalendar from "../components/ReactCalendar";

function Calendar() {
  return (
    <div className="row">
      <div className="col"></div>
      <div className="col">
        {" "}
        <ReactCalendar />
      </div>

      <div className="col"></div>
    </div>
  );
}

function EachCourse({ courseName, location, instructorName, day, month }) {
  return (
    <div className="container">
      <br />
      <div className="card">
        <div className="card-body">
          <div className="row">
            <div className="col-1"></div>
            <div className="col-2">
              <h2> {month}</h2>
              <h2> {day}</h2>
            </div>

            <div className="col-6">
              <h2 className="card-title">{courseName}</h2>
              <h5 className="card-text">Location: {location}</h5>
              <h5 className="card-text">Instructor: {instructorName}</h5>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}
export default class UpcomingCoursesPage extends React.Component {
  render() {
    return (
      <div className="container">
        <div className="ctr header">
          <br />
        </div>
        <Calendar />
        <div className="row">
          <div className="col">
            <EachCourse
              courseName="agile"
              month="Dec"
              day="11"
              location="Boston"
              instructorName="Raj"
            />
          </div>
        </div>
      </div>
    );
  }
}
